import React, { useState, useEffect } from 'react';

const Loader = ({ size = 'medium', message = 'Loading...', type = 'food' }) => {
  const [currentEmoji, setCurrentEmoji] = useState(0);
  
  const foodEmojis = ['ðŸ•', 'ðŸ”', 'ðŸŸ', 'ðŸŒ®', 'ðŸœ', 'ðŸ¥—', 'ðŸ£', 'ðŸ°'];
  
  const sizeClasses = {
    small: {
      container: 'py-4',
      circle: 'w-8 h-8',
      emoji: 'text-lg',
      spinner: 'h-6 w-6 border-2',
      text: 'text-sm'
    },
    medium: {
      container: 'py-8',
      circle: 'w-16 h-16',
      emoji: 'text-2xl',
      spinner: 'h-8 w-8 border-2',
      text: 'text-base'
    },
    large: {
      container: 'py-12',
      circle: 'w-20 h-20',
      emoji: 'text-3xl',
      spinner: 'h-12 w-12 border-3',
      text: 'text-lg'
    }
  };

  const currentSize = sizeClasses[size];

  // Animate food emojis for food type loader
  useEffect(() => {
    if (type !== 'food') return;
    
    const interval = setInterval(() => {
      setCurrentEmoji((prev) => (prev + 1) % foodEmojis.length);
    }, 500);
    return () => clearInterval(interval);
  }, [foodEmojis.length, type]);

  if (type === 'food') {
    return (
      <div className={`flex flex-col items-center justify-center ${currentSize.container}`}>
        <div className="relative mb-4">
          <div className={`${currentSize.circle} bg-gradient-to-r from-orange-400 to-red-500 rounded-full flex items-center justify-center animate-bounce`}>
            <span className={currentSize.emoji}>{foodEmojis[currentEmoji]}</span>
          </div>
          
          {/* Rotating border */}
          <div className={`absolute inset-0 ${currentSize.circle} border-4 border-transparent border-t-orange-500 rounded-full animate-spin`}></div>
        </div>
        
        <p className={`text-gray-600 font-medium ${currentSize.text}`}>{message}</p>
        
        {/* Pulsing dots */}
        <div className="flex space-x-1 mt-2">
          <div className="w-2 h-2 bg-orange-400 rounded-full animate-pulse"></div>
          <div className="w-2 h-2 bg-orange-400 rounded-full animate-pulse delay-75"></div>
          <div className="w-2 h-2 bg-orange-400 rounded-full animate-pulse delay-150"></div>
        </div>
      </div>
    );
  }

  // Standard spinner loader
  return (
    <div className={`flex flex-col items-center justify-center ${currentSize.container}`}>
      <div className={`animate-spin rounded-full ${currentSize.spinner} border-t-2 border-b-2 border-orange-500`}></div>
      {message && (
        <p className={`mt-3 text-gray-600 font-medium ${currentSize.text}`}>{message}</p>
      )}
    </div>
  );
};

// Skeleton loader for content placeholders
export const SkeletonLoader = ({ lines = 3, className = '' }) => {
  return (
    <div className={`animate-pulse ${className}`}>
      {Array.from({ length: lines }).map((_, index) => (
        <div key={index} className={`h-4 bg-gray-200 rounded mb-2 ${index === lines - 1 ? 'w-3/4' : 'w-full'}`}></div>
      ))}
    </div>
  );
};

// Card skeleton for product cards
export const CardSkeleton = () => {
  return (
    <div className="animate-pulse bg-white rounded-xl shadow-soft p-4">
      <div className="h-48 bg-gray-200 rounded-lg mb-4"></div>
      <div className="h-4 bg-gray-200 rounded mb-2"></div>
      <div className="h-4 bg-gray-200 rounded w-3/4 mb-2"></div>
      <div className="flex justify-between items-center">
        <div className="h-6 bg-gray-200 rounded w-20"></div>
        <div className="h-8 bg-gray-200 rounded w-24"></div>
      </div>
    </div>
  );
};

// Page loading overlay
export const PageLoader = ({ message = 'Loading page...' }) => {
  return (
    <div className="fixed inset-0 bg-white bg-opacity-90 backdrop-blur-sm flex items-center justify-center z-50">
      <Loader size="large" message={message} type="food" />
    </div>
  );
};

export default Loader;
